import Avatar from '@material-ui/core/Avatar';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    root: {
      display: 'flex',
      '& > *': {
        margin: theme.spacing(1),
      },
    },
    small: {
      width: theme.spacing(3),
      height: theme.spacing(3),
    },
    large: {
      width: theme.spacing(7),
      height: theme.spacing(7),
    },
  }));

function Home() {
  return (
    <div>
    <Avatar alt="Remy Sharp" className={classes.large} src="https://www.google.com/url?sa=i&url=https%3A%2F%2Ficonscout.com%2Ficon%2Fdoctor-1659516&psig=AOvVaw19_0HRzmcBzNx8-gHK2mSP&ust=1623395402663000&source=images&cd=vfe&ved=0CAIQjRxqFwoTCKDMwKnBjPECFQAAAAAdAAAAABAP"  />
    </div>    
  );
}

export default Home;
